    true,nt"url": null,nt"notes": "The Monthly Program Cost Report (MPCR) replaces
    the Cost Distribution Report (CDR). The MPCR provides summary information about
    Veterans Affairs operational costs, Full Time Equivalents (FTE), and workload (number
    of patient bed days, outpatient clinic stops, etc.). MPCR receives financial data
    feeds from Decision Support System and workload data feeds from National Patient
    Care Database, Home Based Primary Care and Veterans Health Administration (VHA)
    Work Measurement in order to provide the VHA with a flexible cost reporting system.
    The MPCR is assembled from information from all Veterans Affairs Medical Centers
    (VAMCs). MPCR is processed monthly and consists of two reports: station level and
    a national level rollup. These two reports are available to users via Roger's Software
    Development (RSD) on the Austin Information Technology Center mainframe and CD ROM.
    The primary users of MPCR are the VAMC staff, VHA Budget Office, Medical Care Cost
    Recovery, and Deputy Assistant Secretary for Budget.",nt"license_title": "Creative
